			<script>
				// add toggle

				let menuToggle1 = document.querySelector('.toggle1');
				let navigation2 = document.querySelector('.navigation2');
				menuToggle1.onclick = function () {
					menuToggle1.classList.toggle('active');
					navigation2.classList.toggle('active');
				};
				// add active class in selected list item
				let list1 = document.querySelectorAll('.list1');
				for (let i = 0; i < list1.length; i++) {
					list1[i].onclick = function () {
						let j = 0;
						while (j < list1.length) {
							list1[j++].className = 'list1';
						}
						list1[i].className = 'list1 active';
					};
				}
			</script>
